    if(sid==1) return sdBox(p, vec2(baseSize*0.83));
    if(sid==2) return sdEquiTriangle(p*rot(0.2), baseSize*1.15);
    if(sid==3) return sdStar(p*rot(-0.1), baseSize*1.15, uStarPoints, uStarInnerRatio);
